full_text:
If you have symptoms of COVID-19, self-isolate (stay in your room) Phone your GP straight away to see if you need a free COVID-19 test. Other people in your household will need to restrict their movements (stay at home). 
@midlands103 
#MidlandsStaySafe

In a mass immunisation programme, it is vital to set up a publicly funded insurance scheme that would pick up the healthcare costs of serious adverse events that might occur soon after the vaccine is administered.

@GorwayGlobal
